import React from "react";
import { Container, Typography } from "@mui/material";

const Home = () => {
    return (
        <Container>
            <Typography variant="h2" gutterBottom>
                Welcome
            </Typography>
            <Typography variant="body1">Home Page</Typography>
        </Container>
    );
};

export default Home;
